VALUES ('5400113589259', 'Yakitori mix', 'YAKITORI A LA SAUCE SOJA: poulet 69%, sucre, eau, sauce soja (graines de _soja_, _blé_, sel, eau, maltodextrine), sirop de fructose, amidon modifié de tapioca, mirin (sirop de glucose, eau, alcool, riz), sel, épices (gingembre, piment), colorant (caramel ordinaire, extrait de paprika), émulsifiant (esters mono - et diacéthyltartriques des mono - et diglycérides d\'acides gras), stabilisant (triphosphate pentasodique). YAKITORÍ AU CURRY JAUNE: poulet 68%, eau, lait de coco en poudre, sucre, amidon modifié de tapioca, épices (piment, ail, citronnelle, échalote, combava, oignon, curcuma, gingembre, coriandre, poivre, noix de muscade, cannelle, galanga), colorant (curcumine), extrait de levure, sel, amidon de maïs, maltodextrine, sauce soja en poudre (graines de _soja_, _blé_, sucre, maltodextrine), stabilisant (triphosphate pentasodique). YAKITORI A LA SAUCE AU PIMENT: poulet 68%, sucre de canne, eau, vinaigre, piment, amidon modifié de mais, ail en poudre, purée d\'ail, persil, épaississant (gomme xanthane), colorant (extrait de paprika), sel, fructose en poudre, amidon de tapioca, épices (poivron rouge, piment), stabilisant (triphosphate pentasodique), acidifiant (acide citrique), extrait de malt.', 'https://static.openfoodfacts.org/images/products/540/011/358/9259/front_fr.49.400.jpg', '4.8', '1.6', '11.9', '8.4', '0.5', '16.2', '1.3', '0.511811023622047', '', '0');

