INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5400113593980', 'Potage au cerfeuil', 'champignonextractpoeder (paddenstoelen, maltodextrin kervelblad, selderijzaad Bereiding: KOOKPOT: doe de gewenste hoeveelheid porties soep in de kookpan. Verwarm de soep op matig vuur, roer regelmatig om. Voor 250g**: 4 minuten, 500g: 7 minuten, 750g: 10 minuten. MICROGOLFOVEN: doe de gewenste hoeveelheid porties soep in een kom die geschikt is voor de microgolfoven. Verwarm de soep volgens de hieronder aangegeven tijd. Roer de soep halverwege de aangegeven tijd door en verwarm verder. Bij 900W: 250g** 5 minuten, 500g: 7 minuten, 750g: 15 minuten. Bvat: melk, selderij. POTAGE AU CERFEUIL - SURGELÉ Indients: eau, cerfeuil 12,9%, oignon, pomme de terre, e de tournesol non hydrogénée, lait en poudre, amidon modifié de pomme de terre, bouillon de viande (extraits de levure, sel, maltodextrine, huile de tournesol non hydro - génée), sel, extrait de champignon en poudre (champignon, maltodextrine), feuille de cerfeuil, graines de céleri Préparation: CASSEROLE: mettez le nombre souhaité de portions de potage dans la casserole. Faites chauffer le potage à feu moyen en remuant régulèrement. Pour 250q**: 4 minutes, 500g: 7 minutes, 750g: 10 minutes FOUR A MICRO-ONDES: mettez le nombre souhaité de portions de potage dans un plat pour micro-ondes. Faites chauffer le potage le temps indiqué ci-dessous. Mélangez le potage à la moitié du temps indiqué ci-dessous et réchauffez. A 90OW: 250g**: 5 minutes, 500g: 7 minutes', 'https://static.openfoodfacts.org/images/products/540/011/359/3980/front_fr.17.400.jpg', '1.5', '0.3', '3.6', '1.8', '', '1.2', '0.73', '0.28740157480315', '', '1');

